    [],nt"num_tags": 5,nt"name": "upper-souris-national-wildlife-refuge-annual-narrative-report-calendar-year-1987",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Upper
    Souris NWR outlines Refuge accomplishments during the 1987 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. The report
    includes a planning section which discusses management planning and compliance with
    environmental and cultural resource mandates. Refuge administration is outlined;
    information about personnel, youth programs, volunteer programs, funding, and safety
    is given. Habitat management is also covered; subjects include wetlands, forests,
    croplands, grasslands, grazing, haying, fire management, pest control, and water
    rights. The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
    resources, wildlife propagation, scientific collections, animal control, marking
    and bird banding, and disease control. The public uses of the Refuge described in
    this report include outdoor classrooms, interpretive programs, hunting, fishing,
    wildlife observation, and law enforcement. The equipment and facilities section
    of the report provides information about new construction, rehabilitation, major
    maintenance, equipment replacement, communication systems, and computer systems.
    Items of interest are provided at the end. Refuge brochures and field guides are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
